// App.js

import React, { useState, useEffect } from 'react';

import supabase from '../../upabase'; // Le chemin pour accéder à supabase.js depuis Menu.jsx


function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  async function fetchData() {
    try {
      const { data, error } = await supabase
        .from('Conneion')
        .select('*');

      if (error) {
        throw error;
      }

      setData(data || []);
    } catch (error) {
      console.error('Erreur lors de la récupération des données:', error.message);
    }
  }

  return (
    <div className="App">
      <h1>Données de ma_table</h1>
      <ul>
        {data.map((item, index) => (
          <li key={index}>{JSON.stringify(item)}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
